import { useEffect, useState } from 'react';
import logo from '../../peach.png';
import TodoForm from '../Todo/TodoForm.js'
import { CircleFill, TrashFill } from 'react-bootstrap-icons';

function Navbar() {
    const [todos, setTodos] = useState([])
    useEffect(() => {
        fetch('http://localhost:3001/get')
          .then(response => {
            if(!response.ok) {
              throw new Error('Network response was not ok');
            }
            return response.json();
          })
          .then(data => setTodos(data))
          .catch(err => console.log(err));
    }, [])
  return (
    <nav className="Navbar">
      <img src={logo} className="App-logo" alt="logo" />
      <h1>
        What I gotta do.
      </h1>
      <TodoForm/>
      {
        todos.length === 0
        ?
        <div><h2>Nothing Planned Yet</h2></div>
        :
        todos.map(todo => (
            <div className='task'>
              <div className='checkbox'>
                <CircleFill className='icon' />
                <p>{todo.task}</p>
              </div>
              <div>
                <span><TrashFill className='icon'/></span>
              </div>
            </div>
        ))
      }
    </nav>
  );
}

export default Navbar;
